import React from 'react';

function TherapistList(props){
  const {therapists} = props
  return(
    <div>
    {therapists.map(therapist => (
      <div key={therapist.id}>
        <p>{therapist.therapist_first_name}</p>
        <p>{therapist.therapist_last_name}</p>
        <p>{therapist.location}</p>
        <p>{therapist.therapist_last_name}</p>
      </div>
    ))}
    </div>
 )
}

export default TherapistList;
